// Layouts.js
import React, { useState, useEffect } from 'react';
import './Layouts.css';

const Layouts = () => {
  const [isLoading, setIsLoading] = useState(true);
  const [layouts, setLayouts] = useState([
    { id: 1, name: 'Layout 1', description: 'Descrição do Layout 1' },
    { id: 2, name: 'Layout 2', description: 'Descrição do Layout 2' },
    { id: 3, name: 'Layout 3', description: 'Descrição do Layout 3' },
    // Adicione mais itens conforme necessário
  ]);

  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false);
    }, 1000); // Simula 1 segundo de carregamento
  }, []);

  return (
    <div>
      {isLoading ? (
        <div className="loading-screen">
          <div className="spinner"></div>
        </div>
      ) : (
        <div className="layouts-content">
          <h2>Layouts</h2>
          <ul className="layouts-list">
            {layouts.map((layout) => (
              <li key={layout.id} className="layout-item">
                <h3>{layout.name}</h3>
                <p>{layout.description}</p>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Layouts;
